import React, { Component } from 'react'

class ExperienceCard extends Component {

  render() {
    let { logo, company, position, dates, description } = this.props;

    return (
      <div className="experience">
        <img src={logo}></img>
      </div>
    )
  }
}

export default ExperienceCard;
